    {ntt"total": 11,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2014-09-02T23:00:34.466988",nt"name": "conservation-tillage-systems-on-agricultural-land-in-the-conterminous-united-states-1992-na-329",nt"isopen":
    false,nt"url": null,nt"notes": "This data set represents the estimated
    percentage of the 1-km grid cell that is covered by or subject to the agricultural
    conservation practice (CP329 ), Conservation Tillage Systems (CTS) on agricultural
    land by county. Conservation Tillage Systems is described as "managing the amount,
    orientation and distribution of crop and other plant residues on the soil surface
    year-round, while growing crops in narrow slots, or tilled or residue free strips
    in soil previously untilled by full-width inversion implements." (U.S. Department
    of Agriculture, 1995) This data set was created with geographic information systems
    (GIS) and database management tools. The acres on which CTS's are applied were totaled
    at the county level in the tabular NRI database and then apportioned to a raster
    coverage of agricultural land within the county based on the Enhanced National Land
    Cover Dataset (NLCDe) 1-kilometer resolution land cover grids (Nakagaki, 2003).
    Federal land is not considered in this analysis because NRI does not record information
    on those lands.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
